.textarea {
    display: block;
    min-height: 1.92rem;
    padding: 0.3rem;
    width: 100%;
    border: 0;
    outline: none;
    border-bottom: 1px solid #f0f0f0;
    resize:none;
}
.cheeckName{
    width: 1rem;
    text-align: right;
}
.viewer{
    opacity: 0;
    top: 1%;
    position: absolute;
    .image{
        width: 1rem;
        height: 0.5rem;
    }
}
.look{
    color: #1890FF;
    margin-left: 0.2rem;
    position: relative;
}
.deliver-goods header {
    width: 100%;
    background-color: #fff;
}

.deliver-goods header .order-num {
    padding: 0 0.3rem;
    border-bottom: 1px solid #f5f5f5;
    height: 0.67rem;
}

.deliver-goods header .order-num .num {
    width: 4.3rem;
    font-size: 0.26rem;
    color: #282828;
    position: relative;
}

.deliver-goods header .order-num .num:after {
    position: absolute;
    content: '';
    width: 1px;
    height: 0.3rem;
    background-color: #ddd;
    top: 50%;
    margin-top: -0.15rem;
    right: 0;
}

.deliver-goods header .order-num .name {
    width: 2.6rem;
    font-size: 0.26rem;
    color: #282828;
    text-align: center;
}

.deliver-goods header .order-num .name .iconfontYI {
    font-size: 0.35rem;
    color: #477ef3;
    vertical-align: middle;
    margin-right: 0.1rem;
}

.deliver-goods header .address {
    font-size: 0.26rem;
    color: #868686;
    background-color: #fff;
    padding: 0.3rem;
}

.deliver-goods header .address .name {
    font-size: 0.3rem;
    color: #282828;
    margin-bottom: 0.1rem;
}

.deliver-goods header .address .name .phone {
    margin-left: 0.4rem;
}

.deliver-goods header .line {
    width: 100%;
    height: 0.03rem;
}

.deliver-goods header .line img {
    width: 100%;
    height: 100%;
    display: block;
}

.deliver-goods .wrapper {
    width: 100%;
    background-color: #fff;
}

.deliver-goods .wrapper .item {
    border-bottom: 1px solid #f0f0f0;
    padding: 0 0.3rem;
    height: 0.96rem;
    font-size: 0.32rem;
    color: #282828;
    position: relative;
}

.deliver-goods .wrapper .item .mode {
    width: 4.6rem;
    height: 100%;
    text-align: right;
    outline: none;
}

.deliver-goods .wrapper .item .mode .iconfontYI {
    font-size: 0.3rem;
    margin-left: 0.13rem;
}

.deliver-goods .wrapper .item .mode .goods ~ .goods {
    margin-left: 0.3rem;
}

.deliver-goods .wrapper .item .mode .goods {
    color: #bbb;
}

.deliver-goods .wrapper .item .mode .goods.on {
    color: #477ef3;
}

.deliver-goods .wrapper .item .icon-up {
    position: absolute;
    font-size: 0.35rem;
    color: #2c2c2c;
    right: 0.3rem;
}

.deliver-goods .wrapper .item select {
    direction: rtl;
    padding-right: 0.6rem;
    position: relative;
    z-index: 2;
}

.deliver-goods .wrapper .item input::placeholder {
    color: #bbb;
}

.deliver-goods .confirm {
    font-size: 0.32rem;
    color: #fff;
    width: 100%;
    height: 1rem;
    background-color: #477ef3;
    text-align: center;
    line-height: 1rem;
    position: fixed;
    bottom: 0;
}
